// src/App.js
import React from 'react';
import { BrowserRouter as Router, Routes, Route, Link } from 'react-router-dom';

// Komponen Halaman
const HomePage = () => <h2>Ini Halaman Utama</h2>;
const AboutPage = () => <h2>Tentang Kami</h2>;
const ContactPage = () => <h2>Hubungi Kami</h2>;

function App() {
  return (
    <Router>
      <nav>
        <ul>
          <li>
            <Link to="/">Home</Link>
          </li>
          <li>
            <Link to="/about">About</Link>
          </li>
          <li>
            <Link to="/contact">Contact</Link>
          </li>
        </ul>
      </nav>

      <Routes>
        <Route path="/" element={<HomePage />} />
        <Route path="/about" element={<AboutPage />} />
        <Route path="/contact" element={<ContactPage />} />
        {/* Opsional: Halaman 404 */}
        <Route path="*" element={<h2>Halaman Tidak Ditemukan!</h2>} />
      </Routes>
    </Router>
  );
}

export default App;

// Latihan:

// 1. Buat aplikasi sederhana dengan tiga halaman: Home, Products, dan Product Detail.
// 2. Di halaman Products, tampilkan daftar produk. Ketika salah satu produk diklik, navigasikan ke halaman Product Detail (/products/:id) dan tampilkan detail produk berdasarkan ID yang diambil dari URL.
